import React, { useState } from "react";
import { Container, IconContainer, MobileContainer,Icon } from "./AppStyle";

const App =()=>{

  return(
    <Container>
       <MobileContainer>
         <IconContainer>
          <Icon.Arrow /> 
          <Icon.Switch />
         </IconContainer>
       </MobileContainer>
    </Container>

  )
}


export default App;
